use crate::{Error, ToHex};
use ethers_core::types;

#[derive(Clone, Debug, PartialEq, Eq)]
pub struct AddressDetails {
    pub chain_id: String,
    pub address: types::Address,
    pub transaction_hash: Option<types::TxHash>,
    pub block_number: Option<u128>,
    pub transaction_index: Option<u128>,
    pub deployer: Option<types::Address>,
    pub creation_code: Option<types::Bytes>,
    pub runtime_code: types::Bytes,
}

pub async fn batch_retrieve_address_details(
    contracts: &[(&blockscout_client::Client, types::Address)],
) -> Vec<Result<AddressDetails, Error>> {
    let mut contract_details = vec![];
    for (client, contract_address) in contracts {
        let details = retrieve_address_details(client, *contract_address).await;

        contract_details.push(details);
    }
    contract_details
}

pub async fn retrieve_address_details(
    client: &blockscout_client::Client,
    contract_address: types::Address,
) -> Result<AddressDetails, Error> {
    let address = blockscout_client::addresses::get(client, contract_address).await;
    let address = match address {
        Ok(address) if address.is_contract => address,
        Ok(_) => return Err(Error::not_contract()),
        Err(blockscout_client::Error::StatusCode(response))
            if response.status() == blockscout_client::StatusCode::NOT_FOUND =>
        {
            return Err(Error::not_contract())
        }
        Err(err) => {
            tracing::error!(
                contract_address = contract_address.to_hex(),
                "internal error while retrieving address details: {err}"
            );
            return Err(Error::internal("Retrieving address details failed"));
        }
    };

    if let (Some(tx_hash), None) = (address.creation_tx_hash, address.creator_address_hash) {
        tracing::error!(
            contract_address = contract_address.to_hex(),
            transaction_hash = hex::encode(tx_hash),
            "Retrieved address has creation transaction hash, but does not have creator"
        );
        return Err(Error::internal(
            "Address has creation transaction hash, but does not have creator",
        ));
    }

    let smart_contract = blockscout_client::smart_contracts::get(client, contract_address)
        .await
        .map_err(|err| {
            tracing::error!(
                contract_address = contract_address.to_hex(),
                "internal error while retrieving smart-contract details: {err}"
            );
            Error::internal("Error while retrieving smart-contract details")
        })?;

    if smart_contract.deployed_bytecode.is_none() {
        tracing::warn!(
            contract_address = contract_address.to_hex(),
            "Address is contract, but does not contain runtime code"
        );

        return Err(Error::no_runtime_code());
    }

    let transaction = match address.creation_tx_hash {
        None => None,
        Some(tx_hash) => Some(
            blockscout_client::transactions::get(client, tx_hash)
                .await
                .map_err(|err| {
                    tracing::error!(
                        transaction_hash = hex::encode(tx_hash),
                        "internal error while retrieving transaction details: {err}"
                    );
                    Error::internal("Error while retrieving transaction details")
                })?,
        ),
    };

    Ok(AddressDetails {
        chain_id: client.chain_id().to_string(),
        address: contract_address,
        transaction_hash: address.creation_tx_hash,
        block_number: transaction.as_ref().map(|v| v.block),
        transaction_index: transaction.as_ref().map(|v| v.position.into()),
        deployer: address.creator_address_hash,
        creation_code: smart_contract.creation_bytecode,
        runtime_code: smart_contract.deployed_bytecode.unwrap(),
    })
}

#[cfg(test)]
mod tests {
    use super::*;
    use pretty_assertions::assert_eq;
    use std::str::FromStr;
    use tracing_test::traced_test;

    fn to_address(value: &str) -> types::Address {
        types::Address::from_str(value).unwrap()
    }

    fn to_bytes(value: &str) -> types::Bytes {
        types::Bytes::from_str(value).unwrap()
    }

    fn to_tx_hash(value: &str) -> types::TxHash {
        types::TxHash::from_str(value).unwrap()
    }

    #[traced_test]
    #[tokio::test]
    async fn test_retrieve_address_details() {
        let client = blockscout_client::Client::new(blockscout_client::Config::new(
            "10",
            "https://base.blockscout.com/",
        ));

        let test_cases = [
            ("not_a_contract", "0x2E0deA15f32949e027682C70A8afDc7c8e5eB1a5", Err(Error::not_contract())),
            ("not_existing_address", "0xCAfEcAfeCAfECaFeCaFecaFecaFECafECafe1111", Err(Error::not_contract())),
            // Should be called with eth.blockscout.com client
            // ("self-destructed", to_address("0xf42fd2d45bf0740c170cc2af56a2523d0b59ac6f"), Err(Error::no_runtime_code())),
            ("genesis","0x13b0D85CcB8bf860b6b79AF3029fCA081AE9beF2",
             Ok(AddressDetails {
                 chain_id: "10".to_string(),
                 address: to_address("0x13b0D85CcB8bf860b6b79AF3029fCA081AE9beF2"),
                 transaction_hash: None,
                 block_number: None,
                 transaction_index: None,
                 deployer: None,
                 creation_code: None,
                 runtime_code: to_bytes(""),
             })),
            ("from_transaction", "0x8Ab178C07184ffD44F0ADfF4eA2ce6cFc33F3b86",
            Ok(AddressDetails {
                chain_id: "10".to_string(),
                address: to_address("0x8Ab178C07184ffD44F0ADfF4eA2ce6cFc33F3b86"),
                transaction_hash: Some(to_tx_hash("0x574771bcc170f30c87f67dd2734dd2f5ef59c15ca67466ab002af08d767acbe9")),
                block_number: Some(8616108),
                transaction_index: Some(7),
                deployer: Some(to_address("0x9BC9CA7e6A8F013f40617c4585508A988DB7C1c7")),
                creation_code: Some(to_bytes("")),
                runtime_code: to_bytes(""),
            })),
            ("from_internal", "0x5baBfc2F240bc5De90Eb7e19D789412dB1dEc402", Ok(AddressDetails {
                chain_id: "10".to_string(),
                address: to_address("0x5baBfc2F240bc5De90Eb7e19D789412dB1dEc402"),
                transaction_hash: Some(to_tx_hash("0xdd878faf22d0f8e7f3bce69f6a6d7f9f0c42442e01e65b3a24157020b97f72ce")),
                block_number: Some(10287314),
                transaction_index: Some(1),
                deployer: Some(to_address("0x87aF913718f73168D4566bBF51683792aC2680eB")),
                creation_code: Some(to_bytes("")),
                runtime_code: to_bytes(""),
            })),
            ("unverified", "0x6e53131F68a034873b6bFA15502aF094Ef0c5854", Ok(AddressDetails {
                chain_id: "10".to_string(),
                address: to_address("0x6e53131F68a034873b6bFA15502aF094Ef0c5854"),
                transaction_hash: Some(to_tx_hash("0x3ab20ef6048b87d9a096114630281d2c83fbc642b049d637d180c5fae3fe2975")),
                block_number: Some(3236991),
                transaction_index: Some(2),
                deployer: Some(to_address("0xA5961898870943c68037F6848d2D866Ed2016bcB")),
                creation_code: Some(to_bytes("")),
                runtime_code: to_bytes(""),
            })),
        ];

        for (name, address, expected) in test_cases {
            let actual = retrieve_address_details(&client, to_address(address)).await;
            assert_eq!(expected, actual, "{name}; invalid address details");
        }
    }
}
